    data: |
      SELECT - col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col1 * + col0 * ( - col0 ) * + + 47 NOT BETWEEN - - col0 + - col2 AND NULL;
  - name: tab2

outputs:
  - name: q10565.out
    data: |
